• Thank you very much to all of you who came to the presentation of “Disruptive Reflexes” at BOS 2023. 

This is a spontaneous presentation of my work “Blood Wedding”, a pictorial work that walks between the orthodoxy of this contemporary painting and the government of that is the will towards the emancipated and free that ends up ruling us over it, something like what happens in the drama that Lorca wrote about a real event that occurred in my land.

